    if (apiObj is AddressError_InvalidWitnessProgramLength) {
      var pre_field0 = cst_encode_usize(apiObj.field0);
      wireObj.tag = 7;
      wireObj.kind.InvalidWitnessProgramLength.field0 = pre_field0;
      return;
